import React from 'react';

const Home: React.FC = () => {
  return (
    <div className="home-page">
      <h1>Welcome to Nature Explorer</h1>
      <div className="card">
        <p>Explore the beauty of nature through our collection of plants and wildlife.</p>
      </div>
      <div className="features-grid">
        <div className="card">
          <h2>Discover Plants</h2>
          <p>Browse our collection of plants from around the world.</p>
        </div>
        <div className="card">
          <h2>Learn About Nature</h2>
          <p>Deepen your understanding of our natural world.</p>
        </div>
      </div>
    </div>
  );
};

export default Home;
